// GameTypes Whether the game is a single game or part of a doubleheader
var GameTypes = map[int]string{
	0: "Single Game",
	1: "First Game of Doubleheader",
	2: "Second Game of Doubleheader",
}

// Park A ballpark where a game is played
type Park struct {
	ID    string `json:"id"`
	Name  string `json:"name"`
	City  string `json:"city"`
	State string `json:"state"`
}

// League An MLB league
type League struct {
	ID   string `json:"id"`
	Code string `json:"code"`
	Name string `json:"name"`
}

// Team An MLB team
type Team struct {
	ID     string `json:"id"`
	Name   string `json:"name"`
	League League `json:"league"`
}

// Person Can be a player, coach, or ump
type Person struct {
	ID        string `json:"id"`
	FirstName string `json:"firstName"`
	LastName  string `json:"lastName"`
}

